import { Helmet } from "react-helmet";

function PrivacyView() {
    return <div>
        <Helmet>
            <title>Privacy Policy | Mira Softworks</title>
            
            <meta name="description" content="privacy policy"/>
        </Helmet>
    </div>
}

export default PrivacyView;
